	<PARAM NAME="Keyword" VALUE="consp">

<P><A NAME="id_consp"></A><B>(consp <I>object</I>)</B></P>

<P>Returns <A HREF="t.htm">t</A> if <I>object</I> is a cons, otherwise <A HREF="nil.htm">nil</A>.</P>
<PRE><CODE>(consp '(a b c)) =&gt; t
(consp nil) =&gt; nil
(consp 2.3) =&gt; nil</CODE></PRE>
